        static void HintSystem(short current_guess, short target_number, byte type, byte random_event)
        {
            if (game_mode == 1)
                TextColorize(("Red", $"You guessed: {current_guess}, ", true));
            else
                Console.Write($"Previous player guessed: {current_guess}, ");


            if (random_event > 95 && random_event < 100 && PrimeHintOn)
            {
                PrimeHintOn = false;
                if (IsPrime(current_guess))

                    Console.WriteLine("The Number is Prime");
                else
                    Console.WriteLine("The Number is Not Prime");

            }
            else
            {
                switch (type)
                {
                    case 1:
                        short current_guess_proximity = (short)Math.Abs(current_guess - target_number);
                        if (new Random().Next(1, 101) < Level * 5)
                        {
                            Console.WriteLine("No hint for you!");
                        }
                        else
                        {

                            switch (current_guess_proximity)
                            {
                                case > 140:
                                    Console.WriteLine("Your frost bitten!");
                                    break;
                                case > 80:
                                    Console.WriteLine($"You are cold..");
                                    break;
                                case > 40:
                                    Console.WriteLine("Your kinda luke warm...");
                                    break;
                                case > 20:
                                    Console.WriteLine("You are getting really hot!");
                                    break;
                                case > 5:
                                    Console.WriteLine("You are on fire!");
                                    break;
                                case > 0:
                                    Console.WriteLine("Just a little more...");
                                    break;

                            }
                        }
                        break;
                    case 2:
                        if (Convert.ToInt16(current_guess) > target_number)
                        {
                            if (random_event < Level * 3)
                                Console.WriteLine("Guess higher!");//lie
                            else
                                Console.WriteLine("Guess Lower!"); //truth
                        }
                        else
                        {
                            if (random_event < Level * 3)
                                Console.WriteLine("Guess Lower!");//lie
                            else
                                Console.WriteLine("Guess Higher!"); //truth
                        }
                        break;

                }
            }

        }
