        static byte DiceRoll(byte player)
        {
            byte final_roll = (byte)new Random().Next(1, 7);
            byte rand_frame = (byte)new Random().Next(0, 6);
            byte flop = (byte)new Random().Next(6, 6 + dice_flops);

            for (int i = 0; i < flop + 1; i++)
            {

                clear_and_print_header(new string[] { $", {player_name[player]} dice are rolling!" });
                if (player == 1)
                {
                    Console.WriteLine($"{player_name[0]} Rolled a {player_rolls[0]}");
                }
                if (i == flop)

                    Console.WriteLine(dice_draw[final_roll - 1]);

                else
                    Console.WriteLine(dice_draw[rand_frame]);
                Thread.Sleep(dice_frame_interval * 100);
                rand_frame = (byte)new Random().Next(0, 6);

            }

            Console.Write($"{player_name[player]} rolled a {final_roll}");
            Console.WriteLine(" (Press any key to continue)");
            Console.ReadKey(true);
            SoundEngine.Sound.Play("Select");
            return final_roll;
        }

        static void SelectYourProfile(byte player)
        {
            clear_and_print_header();
            Console.Write("Player " + (player + 1));
            byte i = 0;
            SoundEngine.Sound.Play("Waiting", setLoop: true);
            while (true)
            {
                Console.Write(" what is Your name?: ");
