                        if (avatar_key.Key == ConsoleKey.Enter)
                        {
                            player_avatar[player] = i;
                            SoundEngine.StopAllSounds(50);
                            SoundEngine.Sound.Play("Select");
                            SoundEngine.Sound.Play("Applause");
