        static void Title_Screen()
        {
            if (first_run)
            {
                byte i = 0;
                while (true)
                {

                    if (i == 0)
                        SoundEngine.Sound.Play("Intro");
                    byte newline = 20;
                    byte delay = 25;
                    Console.BackgroundColor = ConsoleColor.Cyan;

