                        delay = 50;
                        newline -= 1;
                    }
                    if (i > 2)
                    {
                        Console.WriteLine("\n\t\t    http://www.CornerPi.com    ");
                        delay = 25;
                        newline -= 2;
                    }
                    if (i > 3)
                    {
                        TextColorize(("lightgoldenrodyellow", "\n\t\t    Welcome To Everyones Favourite Game!    ", false));
                        newline -= 2;
                        delay = 20;
                    }
                    if (i > 4)
                    {
                        Console.WriteLine("\n\t\t    Where your game will be televised live to a remote corner in a distant galaxy!    ");
                        delay = 75;
                        newline -= 2;
                    }
                    if (i > 5)
                    {
                        first_run = false;
                        break;
                    }
                    for (byte k = 1; k < newline; k++)
                    {
                        Console.WriteLine();
                    }

                    Console.WriteLine("\t\t\t\t  Press Any Key To Skip  ");
                    if (SkipTitleSleep(delay, 50))
                    {
                        SoundEngine.Sound.Play("Swoosh");
                        _ = SoundEngine.soundLibrary["Intro"].Stop(1000);
                        first_run = false;
                        break;

                    }
                    i++;
                }

            }
        }

        static bool SkipTitleSleep(byte multiplier, byte ms)
        {
            for (int i = 0; i <= multiplier; i++)
            {
                Thread.Sleep(ms);
                if (Console.KeyAvailable)
                {
                    return true;
                }
            }
            return false;
        }
        static void FlushConsoleBuffer()
        {
            while (Console.KeyAvailable)
            {
                Console.ReadKey(true);
            }
        }
        static byte Menu(string[] menu_label, char menu_bullet, byte retain_pos = 1, ConsoleColor select_color = ConsoleColor.Green)
        {
            ConsoleColor console_color_premenu_state = Console.BackgroundColor;
            bool scrolled = false;
            clear_and_print_header();

            //Menu Settings
            byte menu_selector_pos = retain_pos;
            byte menu_select = 0;
            //Menu Caption
            TextColorize(("Yellow", "Menu: (Use Up/Down Arrow and Enter)", false));
            //Pre-print Menu
            for (byte i = 0; i < menu_label.Length; i++)
            {
                if (i == menu_selector_pos - 1)
                {
                    Console.BackgroundColor = select_color;
                    Console.WriteLine($"  {menu_bullet} {menu_label[i]}");
                }
                else
                    Console.WriteLine($"    {menu_label[i]}");
                if (i == menu_selector_pos - 1) Console.BackgroundColor = console_color_premenu_state;
            }

            while (menu_select == 0)
            {
                FlushConsoleBuffer();
                ConsoleKeyInfo Keypressed = Console.ReadKey(true);

                if (!scrolled && (Keypressed.Key == ConsoleKey.UpArrow || Keypressed.Key == ConsoleKey.DownArrow))
                {
                    clear_and_print_header();
                    scrolled = true;
                    SoundEngine.Sound.Play("Scroll");

                    Thread selectThread = new(() =>
                    {
                        if (Keypressed.Key == ConsoleKey.UpArrow)
                        {
                            switch (menu_selector_pos)
                            {

                                case < 2:

                                    menu_selector_pos = (byte)menu_label.Length;
                                    break;
                                default:
                                    menu_selector_pos--;
                                    break;
                            }
                        }
                        else
                        {
                            switch (menu_selector_pos)
                            {
                                case byte b when b == menu_label.Length:
                                    menu_selector_pos = 1;
                                    break;
                                default:
                                    menu_selector_pos++;
                                    break;
                            }
                        }


                        TextColorize(("Yellow", "Menu: (Use Up/Down Arrow and Enter)", false));

                        for (byte i = 0; i < menu_label.Length; i++)
                        {
                            if (i == menu_selector_pos - 1)
                            {
                                Console.BackgroundColor = select_color;
                                Console.WriteLine($"  {menu_bullet} {menu_label[i]}");
                            }
                            else

                                Console.WriteLine($"    {menu_label[i]}");
                            Console.BackgroundColor = console_color_premenu_state;
                        }
                        Thread.Sleep(100);
                        scrolled = false;

                    });
                    selectThread.Start();
                }

                if (Keypressed.Key == ConsoleKey.Enter)
                {
                    SoundEngine.Sound.Play("Select");
                    menu_select = menu_selector_pos;
                    break;
                }

            }

            return menu_select;
        }
        private static void Menu_Options(byte menu_return)
        {
            string[] Options_Menu_label_active_setting;
            while (true)
            {
                Options_Menu_label_active_setting = Options_Menu_label.ToArray();
                Options_Menu_label_active_setting[0] += $" ({option_sound_on})";
                Options_Menu_label_active_setting[1] += $" ({master_volume})";
                Options_Menu_label_active_setting[2] += $" ({option_show_title})";
                Options_Menu_label_active_setting[3] += $" ({taunt_likley}%)";
                Options_Menu_label_active_setting[4] += $" ({clear_allowed})";
                menu_return = Menu(Options_Menu_label_active_setting, '>', menu_return);
                switch (menu_return)
                {
                    case 1:
                        option_sound_on = !option_sound_on;
                        if (option_sound_on)
                        {

                            SoundEngine.Sound.Play("Sweet");
                        }
                        continue;
                    case 2:
                        if (master_volume == 0) option_sound_on = true;

                        if (master_volume >= 90)
                        {
                            master_volume = 0;
                            option_sound_on = false;
                        }
                        else
                            master_volume += 10;
                        continue;
                    case 3:
                        option_show_title = !option_show_title;
                        continue;
                    case 4:
                        if (taunt_likley > 95)
                        {
                            taunt_likley = 0;
                        }
                        else
                        {
                            taunt_likley += 5;
                        }
                        continue;
                    case 5:
                        clear_allowed = !clear_allowed;
                        continue;
                    default:
                        break;
                }
                break;
            }
        }
        private static byte Main_Menu()
        {
            //May want to make Menu a class
            Console.BackgroundColor = default_menu_background_color;
            Console.ForegroundColor = default_menu_foreground_color;

            while (true)
            {
                switch (Menu(Main_Menu_label, '>', 1, menu_item_background_color))
                {
                    case 1:
                        game_mode = 1;
                        break;
                    case 2:
                        game_mode = 2;
                        break;
                    case 3:
                        //This might be useless cant think at the moment to fix it
                        byte menu_return = 1;
                        Menu_Options(menu_return);
                        continue;
                    case 4:
                        Console.Clear();
                        print_ascii(exit_logo);
                        SoundEngine.Sound.Play("Bye");
                        Thread.Sleep(4000);
                        //Delete file clean up should go here
                        Environment.Exit(0);
                        break;
                    default:
                        continue;
                }
                break;
            }
            clear_and_print_header();
            return game_mode;
        }

        static void print_ascii(string ascii_string)
        {

            if (first_run)
            {

                Console.Write("\t");
                Console.ForegroundColor = ConsoleColor.Black;
                foreach (char c in ascii_string)
                {
                    if (c == ' ')
                    {
                        Console.Write(' ');
                    }
                    else if (c == '\n')
                    {

                        Console.Write("\n\t");

                    }
                    else
                    {
                        Console.Write(c);
                    }
                }
            }
            else
            {
                Console.ForegroundColor = ConsoleColor.Yellow;

                foreach (char c in ascii_string)
                {
                    if (c == ' ')
                    {
                        Console.Write(' ');
                    }
                    else
                    {
                        Console.Write(c);
                    }

                }
            }
            Console.WriteLine("");
            Console.ResetColor();
            Console.ForegroundColor = (ConsoleColor)ConsoleColorDefault;
        }

        static void clear_and_print_header(string[]? additional_prints = null)
        {
            if (clear_allowed)
                Console.Clear();
            if (option_show_title)
                print_ascii(logo);
            if (game_mode != 0)
            {

                TextColorize(("grey", Main_Menu_label[game_mode - 1], true));
                if (Level != 0)
                {
                    TextColorize(("grey", $", Level: {Level}", true));
                    if (game_mode == 1)
                        TextColorize(("grey", $"Guesses Available: {allowed_guesses[0]}", true));
                }
                if (additional_prints is null)
                    Console.WriteLine();
            }
            if (additional_prints != null)
            {
                foreach (string prnt in additional_prints)
                    Console.Write(prnt);
                Console.WriteLine();
            }
        }

        static void TextColorize(params (string? Color, string text, bool write)[] parts)
        {

            foreach (var param in parts)
            {

                if (param.Color is null || colors.TryGetValue(param.Color.ToString().ToLower(), out var hex) != true
    || string.IsNullOrWhiteSpace(hex))
                {
                    Console.Write(param.text);
                }
                else
                {
                    hex = hex.TrimStart('#');

                    if (ansiOk)
                    {
                        int r = Convert.ToInt32(hex.Substring(0, 2), 16);
                        int g = Convert.ToInt32(hex.Substring(2, 2), 16);
                        int b = Convert.ToInt32(hex.Substring(3, 2), 16);


                        Console.Write($"\u001b[38;2;{r};{g};{b}m{param.text}\x1b\u001b[38;2;{AnsiColorDefault[0]};{AnsiColorDefault[1]};{AnsiColorDefault[2]}m");
                    }
                    else
                    {
                        int c = Convert.ToInt32(hex.Substring(5, 2), 8);
                        Console.ForegroundColor = (ConsoleColor)c;
                        Console.Write(param.text);
                        Console.ForegroundColor = (ConsoleColor)ConsoleColorDefault;
                    }
                }

                if (!param.write)
                {
                    Console.WriteLine();
                }



            }

        }
        static bool IsPrime(int n)
        {
            if (n <= 1) return false;
            if (n == 2) return true;
            if (n % 2 == 0) return false;

            for (int i = 3; i * i <= n; i += 2)
            {
                if (n % i == 0)
                    return false;
            }

            return true;
        }

