        internal class Sound
        {
            public string? name;
            public float volume = 1.0f;
            private string? filename;
            private MixingSampleProvider? mixer;
            public WaveStream? wavemp3_FileReader { get; private set; }
            private VolumeSampleProvider? volumeProvider;
            private string? extension;
            public bool valid = false;
            public bool playing = false;
            public AutoLoopEndOfLifeSampleProvider? wrapped { get; private set; }

            public bool loop = false;

            public Sound(MixingSampleProvider pass_mixer_pointer)
            {
                mixer = pass_mixer_pointer;
            }
            public bool Loop()
            {
                wavemp3_FileReader?.Position = 0;
                return true;
            }
            public bool OffLoadBase64(string base64Key, string base64Value, string save_folder, string ext, string? external_file = null, float vol = 1.0f)
            {
                extension = ext;
                name = base64Key;
                volume = vol;
                try
                {
                    if (external_file != "true")
                    {
                        var bytes = Convert.FromBase64String(base64Value);//convert base64mp3 to raw bytes
                        filename = Path.Combine(save_folder, $"{base64Key}.{extension}");//Combines Temp Path, the key of the base64 and the file extension.
                        File.WriteAllBytes(filename, bytes);
                    }
                    else
                    {
                        filename = Path.Combine(save_folder, $"{base64Value}.{ext}");
                        if (!File.Exists(filename))
                        {
                            valid = false;
                            Program.WriteError("External File Not found: " + filename);
                        }
                    }

                }
                //This can be improved by using catch e and itterating through exceptions to only declare valid once.
                catch (Exception ex) when (
       ex is ArgumentNullException or FormatException)
                {
                    valid = false;
                    Program.WriteError("Base64 unexpected format or null");
                }


                catch (PathTooLongException)
                {
                    valid = false;
                    Program.WriteError("Path too long, to write audio file.");
                }
                catch (IOException)
                {
                    valid = false;
                    Program.WriteError("Unable to write audio file.");
                }
                catch (UnauthorizedAccessException)
                {
                    valid = false;
                    Program.WriteError("Unable to write audio file, access denied.");
                }

                return true;
            }
            private void RebuildPlaybackChain()
            {
                wavemp3_FileReader?.Dispose();

                wavemp3_FileReader = extension == "wav" ? new WaveFileReader(filename) : new Mp3FileReader(filename);
                volumeProvider = new VolumeSampleProvider(wavemp3_FileReader.ToSampleProvider())
                {

                    Volume = volume * (Program.master_volume / 100)
                };
            }
            public void init_play(bool playedOnLoad = false)
            {
                if (!playedOnLoad)
                {
                    RebuildPlaybackChain();
                }
                playing = true;
                wrapped = new AutoLoopEndOfLifeSampleProvider(volumeProvider, this);
                if (wrapped is not null)
                {
                    mixer!.AddMixerInput(wrapped);
                    activeSounds.Add(wrapped!);
                }
            }

            public async Task Stop(int fade_ms, bool off_load = false)
            {
                if (fade_ms != 0)
                {
                    int steps = 50;
                    int delay = fade_ms / steps;
                    float step = volume / steps;
                    await Task.Run(async () =>
                    {
                        for (int i = 0; volume > 0f; i++)
                        {

                            volume -= step;

                            volumeProvider?.Volume = volume;
                            await Task.Delay(delay); // Non-blocking pause
                        }
                    });
                }
                volume = 0f;
                volumeProvider?.Volume = volume;

                playing = false;

            }

            public bool Deconstructor()
            {
                if (wrapped is not null)
                {
                    activeSounds.Remove(wrapped);
                    mixer!.RemoveMixerInput(wrapped);
                    mixer!.RemoveMixerInput(wrapped);
                }
                wavemp3_FileReader?.Dispose();
                wavemp3_FileReader = null;
                volumeProvider = null;
                wrapped = null;
                valid = false;
                return true;
            }
            public static void Play(string Key, float? vol = null, bool setLoop = false)
            {
                try
                {
                    soundLibrary[Key].PlayInstance(vol, setLoop);
                }
                catch (ArgumentException)
                {

                    Program.WriteError("Wrong argument provided");

                }
                catch (KeyNotFoundException)
                {

                    Program.WriteError("Sound not found in soundLibrary.");
                }
            }
            public bool PlayInstance(float? vol = null, bool setLoop = false)
            {
                if (vol is null)
                {
                    vol = volume;
                }

                if (!setLoop)
                    setLoop = false;
                else
                    loop = setLoop;

                try
                {
                    if (extension == "wav")
                    {
                        wavemp3_FileReader = new WaveFileReader(filename); //unlike byte[] or MemoryStream Mp3FileReader avoids loading into memory all at once.
                    }
                    else
                    {
                        wavemp3_FileReader = new Mp3FileReader(filename);
                    }
                    volumeProvider = new VolumeSampleProvider(wavemp3_FileReader.ToSampleProvider());

                    valid = true;
                }
                catch { valid = false; Console.WriteLine("Loading: " + name + ": Load fail"); return false; }
                ;
                volumeProvider.Volume = volume * (Program.master_volume / 100);
                init_play(true);
                return true;
            }

        }
        public static void StopAllSounds(int ms, List<string>? SoundGroups = null)
        {
            if (SoundGroups != null)
            {
                foreach (string tmp in SoundGroups)
                {


                    if (soundLibrary[tmp].playing)
                    {
                        soundLibrary[tmp].wrapped?.ForceEnd();
                    }

                }
            }
            else
            {
                foreach (AutoLoopEndOfLifeSampleProvider tmp in activeSounds)
                {

                    _ = tmp.Owner.Stop(ms);
                }
            }
        }

        public class AutoLoopEndOfLifeSampleProvider : ISampleProvider
        {
            private readonly ISampleProvider source;
            public bool active { get; private set; } = false;
            public WaveFormat WaveFormat => source.WaveFormat;

            public Sound Owner;


            public AutoLoopEndOfLifeSampleProvider(ISampleProvider source, Sound Owner)
            {
                this.Owner = Owner;
                this.source = source;

            }
            private bool forceEnd = false;

            public void ForceEnd()
            {
                forceEnd = true;
            }
            public int Read(float[] buffer, int offset, int count)
            {
                int read = source.Read(buffer, offset, count);
                if (Owner.playing == false || forceEnd)
                {

                    activeSounds.Remove(this);

                    active = false;
                    return 0;
                }
                if (!active && read != 0)
                {

                    active = true;
                }
                if ((read == 0 || read < count) && active)
                {

                    if (Owner.loop && Owner.Loop())
                    {
                        read = source.Read(buffer, offset, count);

                        if (read > 0)
                        {
                            active = true;
                            return read;
                        }
                    }
                    activeSounds.Remove(this);
                    active = false;
                    return 0;
                }
                return read;
            }
        }
    }

